<!DOCTYPE html>
<html lang="en">
    <head>
        <meta charset="UTF-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">

        <!--Swap our for actual link-->
        <!-- Href should be site domain on that specific page -->
        <link rel="canonical" href="">

        <!-- Site Description/KeyWords -->
        <meta name="description" content="">
        <meta name="keywords" content="">

        <!--Social Media Display-->
        <meta property="og:title" content=""/>
        <meta property="og:description" content=""/>
        <meta property="og:type" content="website"/>
        <meta property="og:url" content=""/>
        <meta property="og:image" content=""/>
        <meta property="og:image:secure_url" content=""/>

        <!--Favicons-->
        <link rel="apple-touch-icon" sizes="180x180" href="">
        <link rel="icon" type="image/png" sizes="32x32" href="">
        <link rel="icon" type="image/png" sizes="16x16" href="">
        <link rel="manifest" href="">
        <meta name="msapplication-TileColor" content="#da532c">
        <meta name="theme-color" content="#ffffff">

        <!-- Preload Font-->
        <link rel="preload" as="font" type="font/woff2" href="" crossorigin>
        <link rel="preload" as="font" type="font/woff2" href="" crossorigin>

        <!-- Preload CSS -->
        <link rel="stylesheet" href="stylePreload.css">

        <!-- Preload Image -->
        <link rel="preload" as="image" href=""/>   
        <link rel="preload" as="image" href="">

        <!-- CSS -->
        <link rel="stylesheet" href="style.css"/>


        <!--Put analytics tag here at the bottom to prevent it from render blocking-->

        <!-- For home page, use full title, including location for SEO. Other pages should just include the page name -->
        <title>

        </title>
    </head>
    <body>
        <!--Screen reader skip main nav-->
        <a class="skip" aria-label="skip to main content" href="#main">Click To Skip To Main Content</a>

        <main id="main"></main>

        <!-- JavaScript that doesn't need to load right away -->
        <script defer src="app.js"></script>
    </body>
</html>
